import React from 'react';
import {
  GoogleMap, 
  withScriptjs, 
  withGoogleMap
} from '@react-google-maps/api';

const Map = (props)=>{
  return (
    <GoogleMap defaultZoom={10}
      defaultCenter={{lat: 0, lng: 0}}
      />);
}

export default withScriptjs(
  withGoogleMap(
    Map
  )
)
